import {HTTP, SWAPI_ROOT, SWAPI_PEOPLE} from '../constants/api';

function getId(url, category) {
    return url.slice(url.length - 2, url.length - 1);

}
export const getPeopleId = url => getId(url, SWAPI_PEOPLE);
